import { Typography } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  Label,
} from "recharts";

export default function VolumeTimeGraph(props) {
  return (
    <Box sx={{ py: 5 }}>
      <Box sx={{ width: 410, marginLeft: 10 }}>
        <Typography variant="h5" align="center">
          {props.title}
        </Typography>
      </Box>
      <LineChart
        width={500}
        height={300}
        data={props.data}
        margin={{
          top: 10,
          right: 10,
          left: 20,
          bottom: 20,
        }}
      >
        <CartesianGrid strokeDasharray="1 1" />
        <XAxis dataKey="date">
          <Label position="bottom" style={{ textAnchor: "middle" }}>
            Date
          </Label>
        </XAxis>
        <YAxis unit=" cm\u00B3">
          <Label angle={270} position="left" style={{ textAnchor: "middle" }}>
            Volume
          </Label>
        </YAxis>
        <Tooltip />
        <Legend />
        <Line
          type="monotone"
          dataKey="val"
          legendType="none"
          stroke="#8884d8"
          activeDot={{ r: 8 }}
        />
      </LineChart>
    </Box>
  );
}
